import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

class Contact extends Component {
  scroll = ()=>{
    window.scrollBy({ top:-1000, left: 0, behavior: 'smooth' })
  }
  render() {
    return (
      <div className="contactContainer">
        <div id="iconContainer">
          <FontAwesomeIcon icon='envelope' />
          <a href='https://twitter.com/shelby_scalia' target="_blank"><FontAwesomeIcon icon={['fab', 'twitter']} /></a>
          <a href='https://linkedin.com/in/shelby-scalia' target="_blank"><FontAwesomeIcon icon={['fab', 'linkedin']}/></a>
          <FontAwesomeIcon icon={['fab', 'github']} />
          <FontAwesomeIcon icon={['fab', 'medium']} />
        </div>
        <div id="upArrow">
          <div onClick={()=>this.scroll()} className='arrow'>
            <FontAwesomeIcon icon="caret-up"/>
          </div>
        </div>
      </div>
    )
  }
}

export default Contact
